const string =
  "";

function isValid(s) {
  const hash = {};
  let second = [];
  let result = "YES";
  for (let x of s) {
    if (hash[x]) {
      hash[x] += 1;
    } else {
      hash[x] = 1;
    }
  }
  let frist = [hash[s[0]], 0];
  for (let x in hash) {
    if (!second.length) {
      if (hash[x] === frist[0]) {
        frist[1] += 1;
        continue;
      } else {
        second = [hash[x], 0];
      }
    } else {
      if (hash[x] === frist[0] || hash[x] === second[0]) {
        if (hash[x] === frist) {
          frist[1] += 1;
        } else if (hash[x] === second[0]) {
          second[1] += 1;
        }
        if (frist[1] > 0 && second[1] >= 1) {
          result = "NO";
          break;
        }
      } else {
        result = "NO";
        break;
      }
    }
  }
  console.log(hash);
  return result;
}

console.log(isValid(string));
